/*Table structure for table `energy_standard` */

DROP TABLE IF EXISTS `energy_standard`;

CREATE TABLE `energy_standard` (
  `info_id` mediumint(7) unsigned NOT NULL,
  `avgs` decimal(12,4) NOT NULL COMMENT '生均数达标值',
  `avgm` decimal(12,4) NOT NULL COMMENT '面均数达标值',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否可用',
  PRIMARY KEY (`info_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='各能源消耗达标标准，各达标值单位按照dict表单位执行';

