  `zbzmxsdwmc` varchar(60) NOT NULL COMMENT '折标准煤系数单位中文描述',
  `coef` float NOT NULL DEFAULT '1' COMMENT '单位系数',
  `status` tinyint(1) NOT NULL DEFAULT '1' COMMENT '状态，是否可用',
  PRIMARY KEY (`std_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='折标系数';

