/*!50003 DROP PROCEDURE IF EXISTS  `getHighSchoolData` */;

DELIMITER $$

/*!50003 CREATE DEFINER=`jn_soft`@`%` PROCEDURE `getHighSchoolData`(IN year_year int)
BEGIN
	DECLARE p_school_id INT(5);
	DECLARE p_school_type INT(5);
	DECLARE p_school_name VARCHAR(150);
	declare done int;
	
	declare highCursor cursor for SELECT school_id,school_type,school_name FROM energy_school WHERE school_type IN (201101,201102,201103,201104);
	declare continue handler for not found set done=1;
	open highCursor;
	loop_label:LOOP
	fetch highCursor into p_school_id,p_school_type,p_school_name;
		if done = 1 then
		leave loop_label;
		end if;
		select sch.school_name,sch.school_type, ROUND(MAX(info_101001),4) `建筑面积/万平方米`,
		ROUND(MAX(info_101002),4) `用能教师数/人`,
		ROUND(MAX(info_101003),4) `用能学生数/人`,
		ROUND(MAX(info_101004),4) `其中编制人数/人`,
		ROUND(MAX(info_101005),4) `公车数量/辆`,
		ROUND(MAX(info_101006),4) `其中编制数量/辆`,
		ROUND(MAX(info_101007),4) `汽油车数量/辆`,
		ROUND(MAX(info_101008),4) `柴油车数量/辆`,
		ROUND(MAX(info_101009),4) `新能源车数量/辆`,
		ROUND(SUM(info_101010),4) `总用电量/`,
		ROUND(SUM(info_101011),4) `用电费用`,
		ROUND(SUM(info_101042),4) `机房用电量`,
		ROUND(SUM(info_101043),4) `机房用电费用`,
		ROUND(SUM(info_101044),4) `市电用电量`,
		ROUND(SUM(info_101045),4) `市电用电费用`,
		ROUND(SUM(info_101046),4) `太阳能、水力风力等发电用电量`,
		ROUND(SUM(info_101047),4) `太阳能、水力风力等发电用电费用`,
		ROUND(SUM(info_101012),4) `水消耗量`,
		ROUND(SUM(info_101013),4) `水消耗费用`,
		ROUND(SUM(info_101048),4) `其中中水消耗量`,
		ROUND(SUM(info_101049),4) `其中中水消耗费用`,
		ROUND(SUM(info_101014),4) `煤消耗量`,
		ROUND(SUM(info_101015),4) `煤消耗费用`,
		ROUND(SUM(info_101016),4) `天然气消耗量`,
		ROUND(SUM(info_101017),4) `天然气消耗费用`,
		ROUND(SUM(info_101018),4) `液化石油气消耗量`,
		ROUND(SUM(info_101019),4) `液化石油气消耗费用`,
		ROUND(SUM(info_101020),4) `人工煤气消耗量`,
		ROUND(SUM(info_101021),4) `人工煤气消耗费用`,
		ROUND(SUM(info_101022),4) `汽油消耗量`,
		ROUND(SUM(info_101023),4) `汽油消耗费用`,
		ROUND(SUM(info_101024),4) `车辆用油量`,
		ROUND(SUM(info_101025),4) `车辆用油费用`,
		ROUND(SUM(info_101026),4) `其他用油`,
		ROUND(SUM(info_101027),4) `其他用油费用`,
		ROUND(SUM(info_101028),4) `柴油消耗量`,
		ROUND(SUM(info_101029),4) `柴油消耗费用`,
		ROUND(SUM(info_101030),4) `其中车辆用油量`,
		ROUND(SUM(info_101031),4) `其中车辆用油费用`,
		ROUND(SUM(info_101032),4) `其他用油`,
		ROUND(SUM(info_101033),4) `其他用油费用`,
		ROUND(SUM(info_101034),4) `煤油消耗量`,
		ROUND(SUM(info_101035),4) `煤油消耗费用`,
		ROUND(SUM(info_101036),4) `热力消耗量`,
		ROUND(SUM(info_101037),4) `热力消耗费用`,
		ROUND(SUM(info_101038),4) `供暖面积`,
		ROUND(SUM(info_101039),4) `供暖费用`,
		ROUND(SUM(info_101040),4) `其他能源消耗量`,
		ROUND(SUM(info_101041),4) `其他能源消耗费用`,
		ROUND(SUM(info_101098),4) `综合能耗，标准煤/吨`,
		ROUND(SUM(info_101099),4) `综合费用，万元`
		FROM energy_school sch 
		left join energy_info inf on inf.school_id = sch.school_id
		 WHERE sch.school_id = p_school_id AND inf.`year` = year_year AND inf.`is_del`= 0 
		GROUP BY sch.school_id;
	end loop loop_label;
	close highCursor;
    END */$$
DELIMITER ;

